import React, { useState } from 'react';
import './MySubscription.css';

const MySubscription = () => {
  const [subscription, setSubscription] = useState({
    planName: 'Premium Health Plan',
    planDetails: 'A comprehensive plan covering all fitness and health services.',
    startDate: '2024-10-01',
    endDate: '2025-10-01',
    amountPaid: 199.99,
    included: ['Personal Trainer', 'Diet Plans', 'Access to Premium Workouts', '24/7 Support'],
    editing: false, // Flag to toggle between view and edit mode
  });

  // Function to handle field updates during editing mode
  const handleChange = (e) => {
    const { name, value } = e.target;
    setSubscription((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  // Function to toggle edit mode
  const toggleEdit = () => {
    setSubscription((prevState) => ({
      ...prevState,
      editing: !prevState.editing,
    }));
  };

  // Handle changes to included services (multi-field)
  const handleIncludedChange = (e, index) => {
    const newIncluded = [...subscription.included];
    newIncluded[index] = e.target.value;
    setSubscription((prevState) => ({
      ...prevState,
      included: newIncluded,
    }));
  };

  // Add new included item to the list
  const addIncludedField = () => {
    setSubscription((prevState) => ({
      ...prevState,
      included: [...prevState.included, ''],
    }));
  };

  return (
    <div className="subscription-container">
      <h2>My Subscription</h2>
      <div className="subscription-details">
        <div className="subscription-field">
          <label>Plan Name:</label>
          {subscription.editing ? (
            <input
              type="text"
              name="planName"
              value={subscription.planName}
              onChange={handleChange}
            />
          ) : (
            <p>{subscription.planName}</p>
          )}
        </div>

        <div className="subscription-field">
          <label>Plan Details:</label>
          {subscription.editing ? (
            <textarea
              name="planDetails"
              value={subscription.planDetails}
              onChange={handleChange}
            />
          ) : (
            <p>{subscription.planDetails}</p>
          )}
        </div>

        <div className="subscription-field">
          <label>Start Date:</label>
          {subscription.editing ? (
            <input
              type="date"
              name="startDate"
              value={subscription.startDate}
              onChange={handleChange}
            />
          ) : (
            <p>{subscription.startDate}</p>
          )}
        </div>

        <div className="subscription-field">
          <label>End Date:</label>
          {subscription.editing ? (
            <input
              type="date"
              name="endDate"
              value={subscription.endDate}
              onChange={handleChange}
            />
          ) : (
            <p>{subscription.endDate}</p>
          )}
        </div>

        <div className="subscription-field">
          <label>Amount Paid:</label>
          {subscription.editing ? (
            <input
              type="number"
              name="amountPaid"
              value={subscription.amountPaid}
              onChange={handleChange}
            />
          ) : (
            <p>${subscription.amountPaid}</p>
          )}
        </div>

        <div className="subscription-field">
          <label>What's Included:</label>
          {subscription.editing ? (
            <>
              {subscription.included.map((item, index) => (
                <div key={index}>
                  <input
                    type="text"
                    value={item}
                    onChange={(e) => handleIncludedChange(e, index)}
                  />
                </div>
              ))}
              <button onClick={addIncludedField} className="add-item-btn">
                Add Another Service
              </button>
            </>
          ) : (
            <ul>
              {subscription.included.map((item, index) => (
                <li key={index}>{item}</li>
              ))}
            </ul>
          )}
        </div>

        <div className="subscription-actions">
          <button onClick={toggleEdit} className="edit-btn">
            {subscription.editing ? 'Save Changes' : 'Change Plan'}
          </button>
        </div>
      </div>
    </div>
  );
};

export default MySubscription;
